import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';

const BasicInput = styled.div`
  display: block;
  border-radius: 3px;
  font-size: 14px;

  & > input {
    padding: 5px 20px;
    border: 1px solid #ddd;
  }
`;

const Input = ({ type }) => {
  return (
    <BasicInput>
      <input type={type}/>
    </BasicInput>
  );
};

Input.propTypes = {
  /** type - text, password */
  type: PropTypes.string,
};

Input.defaultProps = {
  type: 'text'
};

export default Input;
